  const [single, setSingle] = useState({});

  useEffect(() => {
    fetch(`https://jsonplaceholder.typicode.com/posts/${router.params.id}`)
      .then((response) => {
        return response.json();
      })
      .then((json) => {});
  });
  return (
    <Layout>
      <h1>{router.query.id}</h1>
    </Layout>
  );
}
